            autoFocus
            margin="dense"
            id="name"
            label="passwordverify"
            type="password"
            fullWidth
          />
          <br/>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClosesign} color="primary">
            Cancel
          </Button>
          <Button onClick={Handlesignin} color="primary">
            Subscribe
          </Button>
        </DialogActions>
      </Dialog>








      </div>
    </div>
  );
}

export default App;
